import logo from './logo.svg';
import './App.css';

function App() {

  const logo = "https://images.pexels.com/photos/1591447/pexels-photo-1591447.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1";
  return (

      <img src={logo} alt="banner"/>

  );
}

export default App;
